const MORSE_TABLE = {
  '.-': 'a',
  '-...': 'b',
  '-.-.': 'c',
  '-..': 'd',
  '.': 'e',
  '..-.': 'f',
  '--.': 'g',
  '....': 'h',
  '..': 'i',
  '.---': 'j',
  '-.-': 'k',
  '.-..': 'l',
  '--': 'm',
  '-.': 'n',
  '---': 'o',
  '.--.': 'p',
  '--.-': 'q',
  '.-.': 'r',
  '...': 's',
  '-': 't',
  '..-': 'u',
  '...-': 'v',
  '.--': 'w',
  '-..-': 'x',
  '-.--': 'y',
  '--..': 'z',
  '.----': '1',
  '..---': '2',
  '...--': '3',
  '....-': '4',
  '.....': '5',
  '-....': '6',
  '--...': '7',
  '---..': '8',
  '----.': '9',
  '-----': '0',
}
// const str =
//   ''

function decode(expr) {
  // console.log(expr)
  let arr = []
  let resArr = []
  let count = 0

  while (count !== expr.length) {
    arr.push(expr.substring(count, count + 10))
    count += 10
  }

  let arrM = arr.map((e) => {
    let strM = ''
    for (let iE = 0; iE < e.length; iE += 2) {
      switch (e[iE] + e[iE + 1]) {
        case '10':
          strM += '.'
          break
        case '11':
          strM += '-'
      }
    }
    return strM
  })

  // console.log(arrM)

  // arr.map((e, i) => {
  //   if (e === '**********') resArr.push(' ')

  //   for (let iE = 0; iE < e.length; iE += 2) {
  //     // console.log(e[iE] + e[iE + 1])
  //     switch (e[iE] + e[iE + 1]) {
  //       case '10':
  //         resArr.push('.')
  //         break
  //       case '11':
  //         resArr.push('-')
  //     }
  //   }
  // })

  let resultCode = arrM.map((morseCode) => {
    return morseCode == '' ? ' ' : MORSE_TABLE[morseCode]
  })

  return resultCode.join('')
}

// decode(str)
module.exports = {
  decode,
}
